// Dashboard.js
import React, { useState, useEffect } from 'react';
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from 'recharts';
import './Dashboard.css'; // Add some basic CSS for styling

// Define the API URL
const API_URL = 'http://127.0.0.1:5000/api/sensor-data';
const API_HISTORY_URL = 'http://127.0.0.1:5000/api/sensor-history';

// A component to display a single sensor's data and chart
const SensorCard = ({ sensor }) => {
  const [history, setHistory] = useState([]);

  useEffect(() => {
    const fetchHistory = async () => {
      try {
        const response = await fetch(`${API_HISTORY_URL}/${sensor.sensor_name}`);
        const data = await response.json();
        setHistory(data);
      } catch (error) {
        console.error("Failed to fetch history:", error);
      }
    };
    fetchHistory();
    // Refresh history every 30 seconds
    const interval = setInterval(fetchHistory, 30000); 
    return () => clearInterval(interval);
  }, [sensor.sensor_name]);

  return (
    <div className="sensor-card">
      <div className="sensor-header">
        <h2>{sensor.sensor_name}</h2>
      </div>
      <div className="sensor-metrics">
        <p>üå°Ô∏è **Temp:** {sensor.temperature}¬∞C</p>
        <p>üíß **Humidity:** {sensor.humidity}%</p>
        <p>üî• **Heat Index:** {sensor.heat_index}¬∞C</p>
        <p>üíß **Dew Point:** {sensor.dew_point}¬∞C</p>
      </div>

      <div className="sensor-chart">
        <h3 className="chart-title">Temperature History (Last 50 Readings)</h3>
        <ResponsiveContainer width="100%" height={200}>
          <LineChart data={history}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="timestamp" tickFormatter={(timestamp) => new Date(timestamp).toLocaleTimeString()} />
            <YAxis />
            <Tooltip />
            <Legend />
            <Line
              type="monotone"
              dataKey="temperature"
              stroke="#8884d8"
              activeDot={{ r: 8 }}
            />
          </LineChart>
        </ResponsiveContainer>
      </div>
    </div>
  );
};

// The main dashboard component
function Dashboard() {
  const [sensorData, setSensorData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch(API_URL);
        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }
        const data = await response.json();
        setSensorData(data);
      } catch (error) {
        setError(error);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
    const interval = setInterval(fetchData, 5000);
    return () => clearInterval(interval);
  }, []);

  if (loading) {
    return <div>Loading sensor data...</div>;
  }

  if (error) {
    return <div>Error: {error.message}</div>;
  }

  return (
    <div className="dashboard-container">
      <h1>Room Alert Dashboard</h1>
      <div className="sensors-grid">
        {sensorData.map((sensor) => (
          <SensorCard key={sensor.sensor_name} sensor={sensor} />
        ))}
      </div>
    </div>
  );
}

export default Dashboard;
